    false,nt"url": null,nt"notes": "This narrative report for Horicon National
    Wildlife Refuge outlines Refuge accomplishments from May through August of 1949.
    The report begins by summarizing the weather conditions and water conditions during
    this period. Wildlife- including migratory birds, upland game birds, big game animals,
    furbearers, predators, and rodents- is also covered. The Refuge development and
    maintenance section discusses physical development and plantings. Resource management
    is outlined; topics include grazing, and haying. The public relations section of
    the report describes recreational uses, Refuge visitors, and Refuge participation.
    N-R forms and photographs are attached.",nt"license_title": "License Not Specified",nt"extras":
